import React, { Component } from "react";
//import ReactDOM from "react-dom";
import logo from "./logo.svg";
//import "./App.css";
import "./tictac.css";
import TableParameter2 from "./tablechallenge2a.js";
import Football from "./Buttons9";
import Main from "./Main";
import ButtonChallenge1 from "./buttonchallenge1";
import MenuNav1 from "./menunav1";

class App extends Component() {
  constructor(props) {
    super(props);

    this.state = {
      board: Array(9).fill("X"),
    };
  }
  render() {
    const Box = this.state.board.map((box) => <div className="box">{box}</div>);
    return (
      <div className="container">
        <h1> Tic Tac App</h1>

        <div className="board">{Box}</div>
      </div>
    );
  }
}

export default App;
